import random
import string
import xlwt
#注意这里的 excel 文件的后缀是 xls 如果是 xlsx 打开是会提示无效,新建excel表格后要选择文本格式保存
all_str = string.ascii_letters + string.digits
excelpath =('time_result.xls')  #新建excel文件
workbook = xlwt.Workbook(encoding='utf-8')  #写入excel文件
sheet = workbook.add_sheet('Sheet1',cell_overwrite_ok=True)  #新增一个sheet工作表
row = 0
col = 0
for i in range(33):
    print(i)
    for key in time_result[i].keys():
        col = 0
        sheet.write(row,col,'num_workers = %d'%i)
        col += 1
        sheet.write(row,col,key)
        col += 1
        for time in time_result[i][key]:
            sheet.write(row,col,time)
            col += 1
            workbook.save(excelpath)
        sheet.write(row,col,sum(time_result[i][key])/len(time_result[i][key]))
        col += 1
        sheet.write(row,col,min(time_result[i][key]))
        col += 1
        sheet.write(row,col,max(time_result[i][key]))
        col += 1
        sheet.write(row,col,sum(time_result[i][key]))
        row+=1